import React from "react";
import { Link } from "react-router-dom";
import { ShoppingCart } from "phosphor-react";
import "./navbar.css";

export const Navbar = () => {
  return (
    <div className="navbar">
      <div className="links">
        <Link to="/"> 1-р Хоол </Link>
        {/* <Link to="/contact"> 2-р Хоол </Link> */}
        {/* <Link to="/completion">Уух зүйлс</Link> */}
        <Link to="/login">Нэвтрэх</Link>
        <Link to="/cart">   
        <ShoppingCart size={32} />
        </Link>
      </div>
    </div>
  );
};
